# utils/train_matrix.py
import base64, pickle
from scipy.sparse import csr_matrix

_PAYLOAD = """

"""

training_counts = pickle.loads(base64.b64decode(_PAYLOAD))

# Sanity: ensure it is a CSR sparse matrix
if not isinstance(training_counts, csr_matrix):
    # some pickles load as np.matrix-like; try converting
    try:
        training_counts = training_counts.tocsr()
    except Exception:
        raise TypeError(f"Expected csr_matrix, got {type(training_counts)}")